import React from "react";
import "./Pastevents.css";
import Col from "../../components/Col";
import Row from "../../components/Row";
import Container from "../../components/Container";
import Levitation from "../../images/Levitation.png";
import Himalaya from "../../images/Himalaya.psd";



const PastEvents = props => (
    <div>
        <Container style={{color:"white"}}>
            <h1 className="text-center">PastEvents</h1>
            <br />
            <Row>
                <Col size="md-6">
                <img className="img-fluid" alt="levitation" src={Levitation} />
                </Col>
                <Col size="md-6">
                <img className="img-fluid" alt="himalaya" src={Himalaya} />
                </Col>

                </Row>
        </Container>
    </div>
)

export default PastEvents;
